import React from 'react';
import { Link } from 'react-router-dom';


const NavigationBar = (props) => {




    console.log(props);

    return (
        <div>
            <Link to={`/cateogry/${props.navInfo.catId}`}>

                {props.navInfo.catTitle ?
                    `${props.navInfo.catTitle} / `
                : null}
            </Link>

            <Link to={`/cateogry/${props.navInfo.catId}`}>
                {props.navInfo.subCatTitle ?
                    `${props.navInfo.subCatTitle} / `
                : null} 
            </Link>

            {props.title ? 
                props.title
            : null}
        </div>
    );
};

export default NavigationBar;
